VALUES ('WHO Health Topic: Physical Activity', 'Overview Regular physical activity is proven to help prevent and manage noncommunicable diseases (NCDs) such as heart disease, hypertension, stroke, diabetes and several cancers. It also helps to maintain a healthy body weight and can improve mental health, quality of life and well-being. Physical activity refers to all movement. Popular ways to be active include walking, cycling, wheeling, sports, active recreation and play, and can be done at any level of skill and for enjoyment by everybody. Work such as household chores or jobs requiring physical labour is another way to be physically active. Yet, current global estimates show 1 in 3 adults and 81% of adolescents do not do enough physical activity. Furthermore, as countries develop economically, levels of inactivity increase and can be as high as 70% due to changing transport patterns, increased use of technology for work and recreation, cultural values and increasing sedentary behaviour.Sedentary behaviour is periods of low energy expenditure such as sitting and watching TV. Both sedentary behaviour and inadequate levels of physical activity have negative impacts on health systems, the environment, economic development, community and individual well-being and quality of life. Impact Physical inactivity is one of the leading risk factors for noncommunicable diseases (NCDs) and death worldwide.  Alternately, regular physical activity reduces risk of many types of cancer by 8–28%;

