VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'hen a person is only slightly overweight and grows more serious as the body mass index (BMI) climbs. Obesity in childhood is associated with a wide range of serious health complications and an increased risk of premature onset of related illnesses. Studies have found that without intervention, children and adolescents with obesity will likely continue to be obese into adulthood. Prevention and Control Many of the causes of overweight and obesity are preventable and reversable. Although other factors are involved, the fundamental cause of obesity is an imbalance of calories consumed and calories expended. As global diets have changed in recent decades, there has been an increase in the consumption of energy-dense foods high in fat and free sugars. There has also been a decrease in physical activity due to the changing nature of many types of work, more access to transportation and increased urbanization.', '{0.8528181314468384,-0.24576184153556824,0.029989110305905342,0.49069029092788696,0.31529971957206726,0.1521632820367813,-0.17563003301620483,0.16680245101451874,-0.03210045024752617,0.40502771735191345,0.7189840078353882,0.06369727104902267,-0.15992800891399384,-0.4081641435623169,-1.3051878213882446,0.08965029567480087,0.4213115870952606,0.4071398675441742,-0.4834091067314148,-0.14300407469272614,-0.6755426526069641,0.19876651465892792,-0.4968796372413635,-0.2454250156879425,0.19595026969909668,0.6151496767997742,-0.03866869583725929,-0.5954632759094238,0.13233281672000885,0.06108788028359413,-0.6488067507743835,-0.37188947200775146,0.3619629442691803,-0.1839386224746704,0.05271277576684952,0.19672690331935883,0.26325568556785583,1.098171591758728,0.5269331336021423,-0.5253216624259949,-0.06625150889158249,0.20171712338924408,0.031780701130628586,-0.2381739765405655,-0.6423330903053284,0.2469208687543869,-0.3847116529941559,-0.5530197620391846,0.3106236457824707,0.13954061269760132,-0.907213