VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'r.WHO is working with ministries of health and partners to improve access to treatment for epilepsy. Symptoms and treatment Epilepsy is not contagious and is characterized by seizures, which occur because of temporary excessive electric activity in the brain. During seizures, people may lose consciousness or awareness, control of bowel or bladder function, they may not be able to hear or see properly, and their movements may become disturbed. The loss of movement control and sensation can cause injuries from falls. A diagnosis of epilepsy is made by a health professional if there is medical history of at least two seizures. Often this is further confirmed by electroencephalography (EEG), a painless technological method to record and study the electrical activity of the brain.   Treatment for epilepsy can be very effective. With antiseizure medicines, up to 70% of people living with epilepsy could become seizure free.', '{0.22359618544578552,0.04628586769104004,0.8261477947235107,-0.3147071599960327,-0.36047089099884033,0.47411438822746277,0.0514034666121006,-0.6365688443183899,-0.4338946044445038,0.03972586616873741,0.24971741437911987,0.7194033861160278,0.364239901304245,0.4511776268482208,-0.48702555894851685,0.37129420042037964,-0.09351158142089844,-0.038805242627859116,-0.07654178887605667,-0.4860924780368805,-1.1654666662216187,-0.02690257504582405,-0.4861491918563843,-0.3609602153301239,0.39357414841651917,0.16839157044887543,0.23867493867874146,-0.18028035759925842,-0.07156822830438614,0.4306199252605438,-0.843606173992157,-0.1955944150686264,-0.3141156733036041,0.7300366759300232,-0.4966573715209961,-0.2815249562263489,-0.5242847800254822,0.09368953108787537,0.33821260929107666,-0.47325411438941956,-0.37529537081718445,-0.000364793959306553,-0.5909218192100525,-0.22508679330348969,0.12429913878440857,-0.24010801315307617,-0.42246559262275696,-0.39133068919181824,0.5237413048744202,0.5397