VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'ive. With antiseizure medicines, up to 70% of people living with epilepsy could become seizure free. After 2 years of taking medicines without any seizures, a health professional may advise stopping the medicines. Where medicines are not helpful in relieving the condition, some types of surgery can be beneficial. Since people with epilepsy have higher occurrence of psychological conditions such as anxiety and depression, psychosocial help is also useful. WHO response Previous WHO collaborative programmes on epilepsy have shown that integrating epilepsy care in primary health care can significantly reduce the epilepsy treatment gap. Based on the evidence-based methods of the WHO Mental Health Gap Action Programme (mhGAP), WHO supports the training of primary care, non-specialist health care providers to diagnose, treat and follow up people with epilepsy.', '{-0.04806138575077057,-0.1922866702079773,0.595201313495636,-0.7751602530479431,-0.29285335540771484,0.7039424180984497,0.15560504794120789,-0.6255654692649841,-0.5826787948608398,-0.5746128559112549,0.10935322195291519,0.9200006723403931,0.32410600781440735,0.5729785561561584,-0.33442017436027527,0.6799615025520325,-0.268696665763855,0.3420459032058716,-0.10396180301904678,-0.19035132229328156,-1.0129979848861694,-0.2717111110687256,-0.6584104895591736,-0.5779648423194885,0.4316110610961914,-0.08768698573112488,0.256330281496048,-0.5803856253623962,-0.16638842225074768,0.3512825667858124,-0.5439456105232239,-0.12256523221731186,-0.3660402297973633,0.8793016076087952,-0.3566700518131256,-0.2704605460166931,-0.516671895980835,0.03498021885752678,0.4592822194099426,-0.3942925035953522,-0.2153293341398239,-0.012497369199991226,-0.5734981894493103,-0.3241881728172302,-0.06435989588499069,-0.36213862895965576,-0.34720876812934875,0.007816742174327374,1.0546127557754517,0.1556544303894043,0.5499575734138489,-0.4252327084541321,-0.35825610160827637,0