VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ealthy Living Resources Healthy living choices are affected by where you live, work, learn and play. Keeping yourself informed about positive health practices within your environment is an important way to improve your overall health and sense of well-being. What Information is Available? Health Canada encourages Canadians to take a more active role in their health. In this section, you''ll find information to help you make informed choices about your health in areas such as healthy eating, physical activity, pregnancy, mental health and sexual and reproductive health. You''ll also find information intended for specific demographic groups, such as children, women and seniors, and for specific areas of interest, including travel, injury prevention and substance use and abuse. You can also learn about the Canadian Healthy Living Strategy, an initiative led by federal, provincial and territorial governments. Related Resources Looking for health information that speaks directly to you?', '{-0.24974912405014038,0.27571502327919006,0.012221665121614933,0.07640830427408218,0.17428673803806305,0.20402461290359497,0.11769720911979675,-0.07028410583734512,-0.28119805455207825,-0.00039205639041028917,0.33489954471588135,0.6365283131599426,-0.0984320417046547,-0.4600299000740051,-0.6041298508644104,-0.360986590385437,-0.1708807349205017,0.128315731883049,-0.30119797587394714,-0.810423731803894,-0.44406193494796753,0.1920803040266037,-0.3699180483818054,-0.09597847610712051,0.2194780558347702,0.11211823672056198,-0.5138388276100159,-0.6528125405311584,0.018397759646177292,0.3105839788913727,-0.13764885067939758,0.22627729177474976,0.26254865527153015,0.7419312596321106,-0.0014568446204066277,0.05207986757159233,0.13799944519996643,-0.0608849823474884,-0.08285783231258392,0.008568082936108112,-0.5835413932800293,0.1485057771205902,-0.3412439227104187,0.4147953391075134,-0.4867938756942749,0.12123722583055496,